_.Js=[{Eb:0,type:0,text:"A music video showing a naked man coming out of the ocean was reported several times for illegal sexual content."},{Eb:0,type:0,text:"A speech by Angela Merkel about whether Islam belongs to Germany was reported for hate speech as well as terrorist content because Merkel according to the requestors would endanger the country and lead Germany into a catastrophe."},{Eb:0,type:0,text:"A video by Jan B\u00f6hmermann, in which he makes a far right group subject of critical and satirical discussion, received several reports because of alleged hate speech, violence, spam, defamation and insults."},
{Eb:0,type:0,text:"A comment that praises  \u201ccuddling at home\u201d was flagged for \u201charmful or dangerous acts\u201d."},{Eb:0,type:1,text:"A video showing a known German Islamic \u201chate preacher\u201d calling for \u201cdua\u201d and \u201ctawaf\u201d; \u201ctakbir\u201d hacklings can be heard from the community.  The video was reported under NetzDG for terrorist content several times . As the Da\u2019wa spectrum also allows another interpretation than pure propaganda, and propaganda couldn\u2019t be identified in the video, outside counsel identified it as legal."},
{Eb:0,type:1,text:"A video showing footage of weapons and fully blurred dead bodies out of a war zone, the acronym \u201cYPG\u201d is shown on the right corner. Outside counsel did not find any illegal signs, nor any call for propaganda."},{Eb:0,type:1,text:"A video playing the first few seconds of a Horst Wessels song that is prohibited in Germany along with speeches of AfD politicians in the German Parliament. Outside counsel identified this as a use of an illegal sign."},{Eb:0,type:2,text:"A video of a historic anti-semitic speech uploaded by a rabbi to expose and criticize the existence of such views would likely be allowed under our global policies. We may discern this context via the video description and other content uploaded to the creator\u2019s channel. However the same content uploaded to glorify or encourage such views would likely violate our policies thus be removed."},
{Eb:0,type:2,text:"A video of a terrorist attack may be informative news reporting if uploaded by a news outlet or citizen journalist, but that same video clip can be used for recruitment if uploaded by the terrorist organization itself in an effort to glorify or recruit. Informative news would likely be allowed under our global policies, whereas terrorist recruitment would likely violate our policies and thus be removed."},{Eb:0,type:3,text:"Videos that educate and inform patients who have undergone a mastectomy are common on YouTube. These videos often contain information on how the procedure works and techniques for caring for oneself after the operation. Some videos can show exposed breasts or graphic surgery images, but these videos are allowed because of the educational purpose."},
{Eb:0,type:3,text:"There are videos on YouTube documenting the former German NS-regime and the life of Hitler. This footage contains, for example, signs that are ordinarily illegal in Germany. However, these videos are not prohibited by law because of their documentary nature."},{Eb:0,type:3,text:"Although we prohibit content intended to shock or disgust, we make exceptions for scientific content that is primarily intended to educate viewers. Users may find it hard to watch a video of animal dissection, for example, but if the video includes commentary by a veterinary surgeon or expert, it will remain on the platform."},
{Eb:0,type:3,text:"A German art and activist collective creates subversive performance art with the aim to activate civil society to more courageous campaigns. Several times, the collective infiltrated with wrong identities events as an act of civil disobedience. Some of their videos call for illegal acts and disguise their real identity, so this type of content would typically violate YouTube\u2019s Global Community Guidelines, but in this artistic context the content is allowed to remain up."},
{Eb:0,type:4,text:"A company made a defamation claim against a video made by young adults who criticize and compare the company\u2019s venue with other competitors. Price, equipment and size of the venue are subject of discussion. The company claims these statements are untrue."},{Eb:0,type:4,text:"A managing director of a company made a defamation claim against several videos accusing him and the company of fraudulent activities. Main allegations are that the company would fake all their positive reviews online as well as own some dubious websites. The direction claims these statements are untrue."},
{Eb:0,type:4,text:"We received several claims for insults of third parties especially in gaming and music videos. Statements like \u201ccheeky\u201d \u201carrogant\u201d or \u201cintrusive\u201d were reported as illegal insults."},{Eb:1,type:0,text:"A video using parts of a report from a publicly funded media broadcaster criticizes the Islamic religion for being dangerous. We didn\u2019t find a violation of YouTube\u2019s Community Guidelines or German law."},{Eb:1,type:0,text:"A video from a privately owned media broadcaster about bikini fashion was reported for allegedly containing illegal sexual content. We didn\u2019t find a violation of YouTube\u2019s Community Guidelines or German law."},
{Eb:1,type:0,text:"A video was reported that calls for a public protest against the political system in Germany. We didn\u2019t find a violation of YouTube\u2019s Community Guidelines or German law."},{Eb:1,type:1,text:"A video that shows a public speech at an event of a political party was reported for inciting hate against people of color. We found that the video violates German law, and we blocked it for Germany."},{Eb:1,type:1,text:"A video that shows segments of Sponge Bob videos referring to World War II and showing Swastika symbols was flagged for Nazi propaganda. The video contains satire and criticism of fascism. We didn\u2019t find a violation of YouTube\u2019s Community Guidelines or German law."},
{Eb:1,type:1,text:"We received complaints about several videos with parts of a Nazi song that is prohibited in Germany. We found that the videos violate German law, and we blocked them for Germany."},{Eb:1,type:2,text:"A video with critical statements about immigration and Islam using the suicide of a Dutch politician who criticizes Islamic groups was reported for hate speech. We didn\u2019t find a violation of YouTube\u2019s Community Guidelines or German law."},{Eb:1,type:2,text:"A video shows the evolution of several famous soccer team logos, including the logo of Bayern Munich from 1945, featuring a swastika. We didn\u2019t find a violation of YouTube\u2019s Community Guidelines or German law."},
{Eb:1,type:3,text:"A video with a Hitler speech recording was flagged for hate speech. The video was uploaded to a channel dedicated to documenting history; the video title and description frame the historical context. We didn\u2019t find a violation of YouTube\u2019s Community Guidelines or German law."},{Eb:1,type:3,text:"News coverage about a prison riot showing violent scenes was flagged for violence, defamation and hate speech. The video documents a current newsworthy event. We didn\u2019t find a violation of YouTube\u2019s Community Guidelines or German law."},
{Eb:1,type:3,text:"A video with commentary from a former ISIS defector encouraging others not to join ISIS was reported for terrorist content. It shows an ISIS flag, which is a symbol of a banned organization. The video has documentary intent and lacks glorification and support for ISIS. We didn\u2019t find a violation of YouTube\u2019s Community Guidelines or German law."},{Eb:1,type:4,text:"Various comments under make-up tutorial videos were reported for insulting girls and women. We found that the comments violated German law, and we blocked them for Germany."},
{Eb:1,type:4,text:"A video reported on a professional animal keeper, but the title called him an animal abuser. We found that the video violates German law, and we blocked it for Germany."},{Eb:1,type:4,text:"We received a defamation complaint regarding a video in which specific people are called child abusers and pedophiles. We found that the video violates German law, and we blocked it for Germany."},{Eb:1,type:4,text:"We received a defamation complaint from a company regarding a parody video of their original advertisement video, created with the intent to ridicule the company and its employees. We didn\u2019t find a violation of YouTube\u2019s Community Guidelines or German law."}];
